svg.script:
function init(evt) {
	//initialize mapApp object
	myMapApp = new mapApp(false,undefined);
	var getMapDescriptionFile = new getData("geophotos_map.xml",initMap,"xml","get",undefined,undefined);
	getMapDescriptionFile.getData();
}
function loadProjectSpecific() {
	//set status to false that indicates that extent was changed
	myMapApp.photoExtentCheck = false;
	//generate timestamp
	var now = new Date();
	myMainMap.timestamp = now.getTime();
	//loadRasterLayer("pk","getMapFromMapserver.phtml","relief_u_pk_kombi","pk_kombi,Watermark","jpeg",21781);
	//huhj loadRasterLayer("pk","/cgi/mapserv?map=","/home/an/mapserverdata/relief_u_pk_kombi/relief_u_pk_kombi_jpeg.map","pk_kombi,Watermark","jpeg",21781);
	//huhj loadPhotos();
	if (myMapApp.scalebar) {
		drawScaleBar();
	}
	if (!myMainMap.showAdmin) {
		if (myMainMap.adminGroup.hasChildNodes()) {
			myMainMap.adminGroup.removeChild(myMainMap.adminGroup.firstChild);
		}
	}
	else {
		myMainMap.showAdmin = false;
	}
}
